import { Trainers } from "../components/Data"


const Trainer = (props) => {
    return (
        <div>
            {
                Trainers.map((trainer) =>
                    trainer.id == props.id &&
                    trainer.lastName


                )
            }
        </div>
    )
}

export default Trainer
